import React, { useState } from "react";

function TeamMember() {
  const [profiles, setProfiles] = useState([
    {
      id: 555,
      name: "Ahmed BENMOUH",
      Occupation: "developer",
      img: "https://picsum.photos/id/100/200/300",
    },
    {
      id: 666,
      name: "Taha Olavi",
      Occupation: "doctor",
      img: "https://picsum.photos/id/19/200/300",
    },
    {
      id: 777,
      name: "Jasin Hermanni",
      Occupation: "business man",
      img: "https://picsum.photos/id/88/200/300",
    },
  ]);
  return (
    <div>
      <h1>TeamMember</h1>
    </div>
  );
}

export default TeamMember;
